import React, { memo } from "react";
import { useRoutes } from "react-router-dom";

import routes from "./router";
const App = memo(() => {
  return (
    <div className="app">
      <div>header</div>
      <div>

        {useRoutes(routes)}
        </div>
      <div>footer</div>
    </div>
  );
});

export default App;
